import React from "react";
import { Link } from "react-router-dom";
import ".//services.css";
import ImgBlock from "../../ui/clickableBlock/ImgBlock";
import { Serv1, Serv2, Serv3 } from "./../../../img/img_exports";

function Services() {
  return (
    <div className='services'>
      <div className='container'>
        <h1 className='services-header'>Услуги</h1>
      </div>
      <div className='container'>
        <div className='services-blocks'>
          <ImgBlock
            link='/corp_site'
            title='КОРПОРАТИВНЫЙ САЙТ'
            imgSrc={Serv1}
            text='Корпоративный сайт положительно скажестся на имидже, выгодно отличит компанию от конкурентов.'
          />

          <Link to='/marketplace' className='services-block-link'>
            <div className='services-block'>
              <p className='services-block-text'>Text piece 2</p>
            </div>
          </Link>
          <Link to='/landing' className='services-block-link'>
            <div className='services-block'>
              <p className='services-block-text'>Text piece 3</p>
            </div>
          </Link>
        </div>
      </div>
    </div>
  );
}

export default Services;
